import sys
sys.setrecursionlimit(100000000)

def gcd(a, b):
	if b == 0:
		return a
	else:
		return gcd(b, a % b)

def extendedeuclid(a, b):
	if b == 0:
		return a, 1, 0
	else:
		g, x, y = extendedeuclid(b, a % b)
		return g, y, x - (a//b) * y

def modInv(e, fin):
	if gcd(e, fin) == 1:
		return extendedeuclid(e, fin)[1] % fin
	else:
		return 0


